    from typing import List, Dict

    def sort_numbers(numbers: str) -> str:
        value_map: Dict[str, int] = {
            'zero': 0,
            'one': 1,
            'two': 2,
            'three': 3,
            'four': 4,
            'five': 5,
            'six': 6,
            'seven': 7,
            'eight': 8,
            'nine': 9
        }
        
        sorted_numbers = sorted([value_map[num] for num in numbers.split() if num in value_map], key=lambda x: x)
        return ' '.join(str(num) for num in sorted_numbers)